import './maingame.css';
import React, { useState } from 'react';

const GameBox = () => {
    
    return(
        <div className='Container_Game'>
            <div className='Container_Left'>
                <div className='Container_Clock'>
                    <h1>Clock</h1>
                </div>

                <div className='Container_Info'>
                    <h2>Info</h2>
                </div>
            </div>

            <div className='Container_Right'> 
                <div className='Container_Perguntas'>
                    <Botao_esp>Pergunta 1</Botao_esp>
                    <Botao_esp>Pergunta 2</Botao_esp>
                    <Botao_esp>Pergunta 3</Botao_esp>
                    <Botao_esp>Pergunta 4</Botao_esp>
                    <Botao_esp>Pergunta 5</Botao_esp>
                    <Botao_esp>Pergunta 6</Botao_esp>
                    <Botao_esp>Pergunta 7</Botao_esp>
                </div>
            </div>

        </div>
    );
}

export default GameBox;
